/*
通用辅助办案工具及组件
*/
const routers = [
  {
    path: '/wsjcyq',
    name: 'wsjcyq',
    component: () => import('@/views/tyfzbagjjzj/wsjcyq/index'),
    meta: { title: '文书纠错引擎', icon: 'iconfont icon-dian' }
  },
  {
    path: '/znxwgjx',
    name: 'znxwgjx',
    redirect: '/znxwgjx/offline',
    component: () => import('@/views/tyfzbagjjzj/znxwgjx/index'),
    meta: { title: '智能讯（询）问工具箱', icon: 'iconfont icon-dian' }
  },
  {
    path: '/znxwgjx/offline',
    name: 'offline',
    component: () => import('@/views/tyfzbagjjzj/znxwgjx/offline/index'),
    meta: { title: '离线版', icon: 'iconfont icon-dian' },
    hidden: true
  },
  {
    path: '/zhjqr/index',
    name: 'zhjqrIndex',
    // redirect: '/calSupervise/index',
    component: () => import('@/views/zhjqr/index'),
    meta: { title: '检务流程机器人', icon: 'iconfont icon-dian' }
  },
  {
    path: 'http://123.207.222.213:18890',
    name: 'lcjkIndex',
    // redirect: '/calSupervise/index',
    component: () => import('@/views/zhjqr/index'),
    meta: { title: '流程监控引擎', icon: 'iconfont icon-dian' }
  }
]
export default routers
